import React from 'react'
// import {Card} from "react-bootstrap";


function Dish({dish}){

  return(
      <div className="card" style={{width: "18rem"}}>
      <img src={`data:image/jpeg;base64,${dish.dish_img}`} className="card-img-top" alt="dish-img" />
      <div className="card-body">
        <h5 className="card-title">{`${dish.dish_name}`}</h5>
        <p className="card-text">{`${dish.dish_ingredients}`}</p>
        <p className="card-text">{`${dish.dish_price}`}</p>
        <p className="card-text">{`${dish.dish_description}`}</p>
        <p className="card-text">{`${dish.dish_category}`}</p>
        <button type="button" className="btn btn-success" style={{margin:"10px"}}>Add</button>
        <button type="button" className="btn btn-success" style={{margin:"10px"}}>Delete</button>
      </div>
    </div>
  )

}


export default Dish;
